/**
 * @class 
 * @description WOSA应答或时间中的时间类型
 * @property {number} wYear 年份
 * @property {number} wMonth 月份
 * @property {number} wDayOfWeek 星期
 * @property {number} wDay 每月几号
 * @property {number} wHour 小时
 * @property {number} wMinute 分钟
 * @property {number} wSecond 秒
 * @property {number} wMilliseconds 毫秒
*/
declare class SYSTEMTIME {
    wYear:number;
    wMonth:number;
    wDayOfWeek:number;
    wDay:number;
    wHour:number;
    wMinute:number;
    wSecond:number;
    wMilliseconds:number;
}